import React from 'react';

const LatestMovies = () => {
  return (
    <div className="main-section">
      <div className="container">
        <div className="latest-section">
          <div className="content">
            <h2>Latest YIFY Movies Torrent</h2>
          </div>
        </div>
      </div>

    </div>
  );
}

export default LatestMovies;
